import React from 'react'
import SignIn from './SignIn'
import SignUp from './SignUp'

function FormModalContainer({ isSignInWindowOpen, isSignUpWindowOpen }) {
	return (
		<div>
			{isSignInWindowOpen && <SignIn />}
			{isSignUpWindowOpen && <SignUp />}
		</div>
	)
}

export default FormModalContainer
